var title_f16_54_17259="Contraindications to NPPV";
var content_f16_54_17259=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F60442&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F60442&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Contraindications to noninvasive positive pressure ventilation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Cardiac or respiratory arrest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Nonrespiratory organ failure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Severe encephalopathy (eg, GCS &lt;10)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Severe upper gastrointestinal bleeding",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hemodynamic instability or unstable cardiac arrhythmia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Facial or neurological surgery, trauma, or deformity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Upper airway obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inability to cooperate/protect airway",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inability to clear secretions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High risk for aspiration",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    GCS: Glasgow Coma Score.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from International Concensus Conferences in Intensive Care Medicine:Noninvasive positive pressure ventilation in acute respiratory failure. Am J Respir Crit Care Med 2001; 163:288. Copyright &copy; 2001 American Thoracic Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
