var title_f16_54_17260="ACC AHA skills internal CV I";
var content_f16_54_17260=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57223%7ECARD%2F65048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57223%7ECARD%2F65048&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=13\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cognitive skills necessary to perform internal DC cardioversion",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physicians should have knowledge of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cognitive and technical skills for performing intracardiac electrophysiologic study",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Principles of intracavitary cardioversion with",
"catheter technology, catheters, chest electrodes, or whatever variant",
"the operator plans to use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Indications and complications associated with transvenous catheterization and with the intracavitary delivery of DC shock",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The safe delivery of DC shock and the limit of energy that can be delivered via electrode catheters",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The use of conscious sedation or, when appropriate, anesthesia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The use of intravenous antiarrhythmic medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cognitive skills necessary for external DC cardioversion",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Tracy, CM, Akhtar, M, DiMarco, JP, et al. Circulation 2000; 102:2309.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Technical skills necessary to perform internal DC cardioversion",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Competency in performing diagnostic cardiac electrophysiology studies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ability to place electrode catheters in appropriate locations for intracardiac synchronization and DC cardioversion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Familiarity with the catheter characteristics, synchronization, and DC cardioversion equipment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ability to confirm the timing and energy of the shock for safe shock delivery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adequate electrocardiographic and rhythm monitoring equipment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ability to handle complications, including the use of temporary pacing and defibrillation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Proficiency in the appropriate use of sedation during procedures, including airway management",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Tracy, CM, Akhtar, M, DiMarco, JP, et al. Circulation 2000; 102:2309.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
